import React from "react"
import ReactDOM from "react-dom"
import profilePic from "./image/profile.jpg"


function Profile(){
    return(
        <div className="profileHolder">
            <img src={profilePic} alt="" />
            <h1>Kanye West</h1>

        </div>
    )
}

function Description(){
