        <div>
           
        </div>
    )
}

function Footer(){
    return(
        <footer>
            
        </footer>
    )
}

function App(){
    return(
        <div className="mainDiv">
            <Profile/>
            <Description/>
            <Footer/>
        </div>
    )
}

ReactDOM.render(<App/>,document.getElementById("root"))
